(function($){'use strict';$(document).ready(function(){var superuser=$('#id_is_superuser'),staff=$('#id_is_staff'),orgs=$('#openwisp_users_organizationuser-group');superuser.change(function(e){if(superuser.is(':checked')){orgs.hide();orgs.find('.field-is_admin input').prop('checked',false);orgs.find('.field-organization select').val('');if(!staff.is(':checked')){staff.trigger('click');}}else{orgs.show();}});staff.change(function(e){if(!superuser.is(':checked')){orgs.find('.field-is_admin input').prop('checked',staff.is(':checked'));}});staff.trigger('change');superuser.trigger('change');});}(django.jQuery));